import React from 'react';
import screens from './index';
import { createDrawerNavigator } from '@react-navigation/drawer';

const Drawer = createDrawerNavigator();

const MainScreen = () => (
    <Drawer.Navigator>
        {screens.map((screen) => (
        <Drawer.Screen
            key={screen.name}
            name={screen.name}
            component={screen.component}
            options={{
            }}
        />
        ))}
    </Drawer.Navigator>
);

export default MainScreen;
